class ProjectListStaffRequestModel {  String? search;  int? branchId;  int? departmentId;  ProjectListStaffRequestModel({this.search, this.branchId, this.departmentId});  ProjectListStaffRequestModel.fromJson(Map<String, dynamic> json) {    search = json['search'];    branchId = json['branch_id'];    departmentId = json['department_id'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['search'] = this.search;    data['branch_id'] = this.branchId;    data['department_id'] = this.departmentId;    return data;  }}